import './Header.css';
import React from 'react';
import ConnectWallet from 'components/Controllers/ConnectWallet'

function Header() {
  return (
    <header className="main-header">
      <nav className="navigation">
        <div className="main-header__logo">
          <span className="logo__company-name">Logo</span>
        </div>
        <ConnectWallet />
      </nav>
    </header>
  );
}

export { Header };
